import { StyleSheet } from "react-native";
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import ProfileCard from "./components/home/ProfileCard";
import { MaterialCommunityIcons } from "react-native-vector-icons"
import List from "./components/list/List";
import Name from "./components/name/Name"
import ChatGPT from "./components/chatgpt/ChatGPT";

const Tab = createBottomTabNavigator();

export default function Navigation() {
    return (
        <Tab.Navigator>
            <Tab.Screen style={styles.Button}  name=" " component={ProfileCard} options={{
                tabBarLabel: "Diagnóstico",
                tabBarIcon: ({ color, size }) => {
                    return <MaterialCommunityIcons name="hospital-box-outline" color={color} size={size} />
                }
            }} />
            <Tab.Screen style={styles.Button}  name="list" component={List} options={{
                tabBarLabel: "Información",
                tabBarIcon: ({ color, size }) => {
                    return <MaterialCommunityIcons name="information" color={color} size={size} />
                }
            }} />
            <Tab.Screen style={styles.Button} name="name" component={Name} options={{
                tabBarLabel: "Estadísticas",
                tabBarIcon: ({ color, size }) => {
                    return <MaterialCommunityIcons name="chart-bar" color={color} size={size} />
                }
            }} />
            <Tab.Screen style={styles.Button} name="chatgpt" component={ChatGPT} options={{
                tabBarLabel: "Configuración",
                tabBarIcon: ({ color, size }) => {
                    return <MaterialCommunityIcons name="account-cog" color={color} size={size} />
                }
            }} />

        </Tab.Navigator>

    );
}

const styles = StyleSheet.create({
    Button: {
        flex: 1,
        activeTintColor: 'blue',
          inactiveTintColor: 'grey',
        alignItems: 'center',
        justifyContent: 'center',
    },
});
